import ReactDOM from 'react-dom';
import "./App.css";

function App()
{
	return(
	<div>
		<h1>Hi there!</h1>
	  	<ul>
			<li>
		  		<a>Divide And Conquer</a>
			</li>
	  	</ul>
	</div>
	);
}

export default App;
